import { useSelector } from "react-redux";
import "../navbar.css";


export default function Navbar(){

    const utente = useSelector(state => state.utente);
    const conto = useSelector(state => state.conto);


    function visualSideBar(){
        

        (utente.ruolo)?
        <>
        {utente.ruolo==1 ?<>
        <div class="sidebar">
        <h1>CIAO ADMIN</h1>
       </div>
        </>:
        <>
        <div class="sidebar">
        <h1>CIAO UTENTE</h1>
        </div>        
        </>}

        </>:
        <>
        </>

     
        

        
    }


return(
    <>
    
    
    <nav class="navbar">
        <h1 className="h1-navbar">Benvenuto in ExoBank</h1>
    </nav>

    {visualSideBar}
    
    
    
    
    
    
    
    </>
)





}
